window.bcOpti = (function() {
  return {
    contentSwap: function (src, dest) {
      const COOKIE_NAME = "ABTESTS";

      function getExpiresDate(){
        const d = new Date();
        d.setTime(d.getTime() + (24*60*60*1000));
        return "expires="+ d.toUTCString();
      }

      function getCookie() {
        let name = `${COOKIE_NAME}=`;
        let decodedCookie = decodeURIComponent(document.cookie);
        let ca = decodedCookie.split(";");
        for (let i = 0; i < ca.length; i++) {
          let c = ca[i];
          while (c.charAt(0) == " ") {
            c = c.substring(1);
          }
          if (c.indexOf(name) == 0) {
            return c.substring(name.length, c.length);
          }
        }
        return "";
      }

      let value = `${src},${dest}`;
      const cookie = getCookie();
      const expires = getExpiresDate();
      if (cookie.includes(`${dest}`)) return;

      if (cookie) value = `${cookie}|${value}`;
      document.cookie = `${COOKIE_NAME}=${value};${expires}`;
    }
  };
})();
